import React, { Component, Fragment } from 'react';
import { Link } from "react-router-dom";
import Mynav from '../component/route/MyNav';

class Newcontact extends Component{

    render (){
        return (
            <Fragment>
                <div>
                    <Mynav/>
                    <h1>New Contact</h1>
                    <Link></Link>

                </div>
            </Fragment>
        )
    }
}
export default Newcontact;
